import React, { Fragment } from 'react';
import { useToggle } from '../../Resources/util/useToggle'
import './Team.css';
import '../../Containers/Terminal/Terminal.css'

import {ReactComponent as ExternalLink} from "../../Resources/icons/external-link.svg";
import {ReactComponent as Folder} from "../../Resources/icons/134.svg";
import mainLogo from "../../Resources/icons/134.png";
import Hat1 from "../../Resources/icons/134.png";
import Hat2 from "../../Resources/icons/11.png";
import Hat3 from "../../Resources/icons/tihapp_rev.png";
import AppData from './Images';

const content = (props)=>{
    let result = <ul>
        
    {props.repos.map((obj,index) =>{
        if(props.getLoad || index < 6)
            return(<li key={`work-element-${index}`}>
                <div className="insideContainer">
                    <div className="logo">
                   
                        < img  src={AppData.adata.map(({index, src}) => <img key={id} src={src} />)} alt="fireSpot" className="folder"/>
                    </div>
                    
                    <div className="title">{obj.name}</div>

                    <div className="description">{obj.description}</div>

                    <footer>{obj.languages}</footer>
                </div>
            </li>)
        else
            return <Fragment key={`work-element-${index}`}></Fragment>
    })}
    </ul>
    if (props.test)
        return <></>
    return result
}

const Work = (props) =>{
    let currentContent = content(props)
    return(
    <div className = "main">
        <div className="projects">
            <div className="workHeader">
                <h3>Meet the team</h3>
            </div>
            {currentContent}
          
        </div>
    </div>
    );
}

export default Work;
